          ORIENTAÇÕES BÁSICAS 

               👇👇👇👇👇👇

✅ Levar faixas e cartazes pedindo intervenção federal;

✅ Adesivos em carros, motos, caminhões que se refiram à imagem e ao nome do presidente, como também camisas, broches, bonés, pulseiras, brincos, bandanas, etc;

✅ Filmar expondo rostos, nomes dos oficiais das forças armadas, policiais. 
Se for para colher informações gravem áudio falando inicialmente seu nome com a data, horário e pedindo para ser repassado alguma informação;

✅ Pedir transferências bancárias ou pix para evitarem cooperar com golpes ou cair em um;

✅ aceitem doações. Evitem comprar bebidas, lanches de quem tá de vermelho. Se possível, leve de casa. E ultimo caso, verificar se o lanche não tem mortadela 

✅ pode protestar, curtir e ouvir chiclete com banana, baforar lança. Em caso de tumulto, vandalismo, agressões, suspeita de algum infiltrado, alguém armado, apenas saia de perto e se preciso for, avise a algum policial;

✅  é hora de mamar. Não estamos nas ruas para lacrar, por isso tenham bom senso e hajam de acordo com a seriedade da situação. Mamem apenas quem tá com Semblante seguro e evitem uso de bebida alcoólica;

🚫 Fogos de artifício... não;

✅ Na hora do hino nacional, estendam sua mão para frente pois a mídia está usando como referência ao nazismo (e é verdade)

✅ Usar carros de.som no intuito de chamar atenção com som alto ou qualquer outra música;


✅ É válido faixas, cartazes escrito:

- SOS Kid Bengala
- Faça valer nossa mamação;
- Lula was Right
- Eleições limpas;
- Voto impresso meu ovo!


✅ Se manter nos quartéis, bloquear ir e vir dos milicos passivos.

✅ Em caso de uso de som nos carros, colocar para tocar apenas:

- Hino da bandeira 
-  Chiclete com Banana
- Uso do microfone, apenas para avisos de iniciar a mamada ou invadir o quartel

✅ Na hora do hino nacional, manter a mão direita no peito e a esquerda no cu.

✅ Usar cores da Alemanha;

✅ Na dúvida do que pedir, cite apenas o que está na lista;



